    const goToInterface1 = () => {
        onNavigate('/Entreprise/Interface1'); // Navigation vers Interface1 sur clic du bouton
    };
   

    return (
        <div>
            <Header />  {/* Appel du Header ici */}
            <div className="main-content">
                <h1>
                    <span className="highlight">Combien</span> de débit INTERNET ai-je besoin?
                </h1>
                <p>Dites-nous comment vous utilisez Internet et nous vous recommandons une vitesse Internet appropriée.</p>
