                    <div className="table-row">
                        <div className="table-cell">
                            <h2>Résidentiel</h2>
                            <button className="btn" onClick={onStartClick}>Commencer</button>
                        </div>
                        <div className="table-cell">
                            <h2>Entreprise</h2>
                            <button className="btn" onC>Commencer</button>
                        </div>
                    </div>
                </div>
            </div>
            <Footer />  {/* Appel du Footer ici */}
        </div>
    );
}

export default MainContent;
